import React from 'react';

import logo from './logo.png';
import { useNavigate } from 'react-router-dom';

import './header.css';

function WebHeader({title, quote}) {
  const navigate = useNavigate();
  return (
    <header className='header'>
      <div class='header-container'>
        <div class='title'>{title}</div>
        <div class='quote'>"{quote}"</div>
      </div>
        <div className='nav-bar'>
        <img src={logo} className="logo" alt="self" />
          <div class='nav-buttons'>
            <button className='nav-button' onClick = {navigate("/")} >Home</button>
            <button className='nav-button' onClick = {navigate("/projects")}>Projects</button>
            <button className='nav-button'>Experience</button>
            <button className='nav-button'>Education</button>
            <button className='nav-button'>About Me</button>
          </div>
        </div>
    </header>   
  );
}

export default WebHeader;
